struct ares_dns_qd {
  char               *name;
  ares_dns_rec_type_t qtype;
  ares_dns_class_t    qclass;
}

typedef struct {
  struct in_addr addr;
} ares_dns_a_t;

typedef struct {
  char        *mname;
  char        *rname;
  unsigned int serial;
  unsigned int refresh;
  unsigned int retry;
  unsigned int expire;
  unsigned int minimum;
} ares_dns_soa_t;

typedef struct {
  unsigned short preference;
  char          *exchange;
} ares_dns_mx_t;

typedef struct {
  unsigned short type_covered;
  unsigned char  algorithm;
  unsigned char  labels;
  unsigned int   original_ttl;
  unsigned int   expiration;
  unsigned int   inception;
  unsigned short key_tag;
  char          *signers_name;
  unsigned char *signature;
  size_t         signature_len;
} ares_dns_sig_t;

typedef struct {
  struct ares_in6_addr addr;
} ares_dns_aaaa_t;

typedef struct {
  unsigned short priority;
  unsigned short weight;
  unsigned short port;
  char          *target;
} ares_dns_srv_t;

typedef struct {
  unsigned short order;
  unsigned short preference;
  char          *flags;
  char          *services;
  char          *regexp;
  char          *replacement;
} ares_dns_naptr_t;

typedef struct {
  unsigned short opt;
  unsigned char *val;
  size_t         val_len;
} ares_dns_optval_t;

typedef struct {
  unsigned short udp_size; /*!< taken from class */
  unsigned char  version;  /*!< taken from bits 8-16 of ttl */
  unsigned short flags;    /*!< Flags, remaining 16 bits, though only
                            *   1 currently defined */
  ares_array_t  *options;  /*!< Type is ares_dns_optval_t */
} ares_dns_opt_t;

typedef struct {
  unsigned char  cert_usage;
  unsigned char  selector;
  unsigned char  match;
  unsigned char *data;
  size_t         data_len;
} ares_dns_tlsa_t;

typedef struct {
  unsigned short priority;
  char          *target;
  ares_array_t  *params; /*!< Type is ares_dns_optval_t */
} ares_dns_svcb_t;

typedef struct {
  unsigned short priority;
  unsigned short weight;
  char          *target;
} ares_dns_uri_t;

typedef struct {
  unsigned char  critical;
  char          *tag;
  unsigned char *value;
  size_t         value_len;
} ares_dns_caa_t;

typedef struct {
  unsigned short type;   /*!< Not ares_rec_type_t because it likely isn't one
                          *   of those values since it wasn't parsed */
  unsigned char *data;   /*!< Raw RR data */
  size_t         length; /*!< Length of raw RR data */
} ares_dns_raw_rr_t;

struct ares_dns_rr {
  ares_dns_record_t  *parent;
  char               *name;
  ares_dns_rec_type_t type;
  ares_dns_class_t    rclass;
  unsigned int        ttl;

  union {
    ares_dns_a_t      a;
    ares_dns_ns_t     ns;
    ares_dns_cname_t  cname;
    ares_dns_soa_t    soa;
    ares_dns_ptr_t    ptr;
    ares_dns_hinfo_t  hinfo;
    ares_dns_mx_t     mx;
    ares_dns_txt_t    txt;
    ares_dns_sig_t    sig;
    ares_dns_aaaa_t   aaaa;
    ares_dns_srv_t    srv;
    ares_dns_naptr_t  naptr;
    ares_dns_opt_t    opt;
    ares_dns_tlsa_t   tlsa;
    ares_dns_svcb_t   svcb;
    ares_dns_svcb_t   https; /*!< https is a type of svcb, so this is right */
    ares_dns_uri_t    uri;
    ares_dns_caa_t    caa;
    ares_dns_raw_rr_t raw_rr;
  } r;
}

